<script>

import { mapActions, mapMutations, mapGetters, mapState } from 'vuex';

export default {
    data() {
        return {
            data: {
                username: '',
                password: '',
                remember_me: false,
            },
            loading: false,
            showSnackbar: false,
            position: 'left',
            duration: 4000,
            isInfinity: false
        }
    },
    created() {
        if (this.isAuth) {
            this.$router.push({ name: 'home' })
        }
    },
    computed: {
        ...mapGetters(['isAuth']),
      	...mapState(['errors'])
    },
    methods: {
        ...mapActions('auth', ['submit']),
        ...mapMutations(['CLEAR_ERRORS']),

        postLogin() {
            this.loading = true;
            this.submit(this.data).then(() => {
                if (this.isAuth) {
                    this.CLEAR_ERRORS()
                    this.$router.push({ name: 'home' })
                }else{
                    this.showSnackbar = true;
                    this.loading = false;
                }
            })

        },
    }
}
</script>
<style lang="scss" scoped>
  .md-progress-spinner {
    margin: 24px;
  }
</style>
<!-- HTML SECTION -->
<template>
    <div class="login-container">
        <div class="login-box">
            <router-link :to="{ name: 'home' }" class="login-logo md-button">
                <img class="logo-login md-image" src="data:image/png;base64,"></img>
                Polling
            </router-link>
            <div class="login-box-body">
                <div class="form-group" :class="{'has-error': errors.username}">
                    <input type="text" class="form-control" placeholder="Username" v-model="data.username" autocomplete="false">
                    <span class="glyphicon glyphicon-envelope form-control-feedback"></span>
                    <p class="text-danger" v-if="errors.username">{{ errors.username[0] }}</p>
                </div>
                <div class="form-group" :class="{'has-error': errors.password}">
                    <input type="password" class="form-control" placeholder="Password" v-model="data.password" autocomplete="false">
                    <span class="glyphicon glyphicon-lock form-control-feedback"></span>
                    <p class="text-danger" v-if="errors.password">{{ errors.password[0] }}</p>
                </div>
                <md-snackbar class="alert alert-danger" :md-position="position" :md-duration="isInfinity ? Infinity : duration" :md-active.sync="showSnackbar" md-persistent>
                    <span>{{ errors.invalid }}</span>
                    <md-button class="md-primary" @click="showSnackbar = false">Close</md-button>
                </md-snackbar>
                <div v-if="loading" class="loading" >
                    <md-progress-spinner class="md-accent" :md-diameter="150" :md-stroke="10" md-mode="indeterminate"></md-progress-spinner>
                </div>
                <div class="checkbox">
                    <label>
                        <input type="checkbox" v-model="data.remember_me"> Remember Me
                    </label>
                </div>
                <md-button type="submit" class="btn-submit md-raised md-primary" @click.prevent="postLogin">Login</md-button>
            </div>
        </div>
    </div>
</template>


